const Card = (data) => {
    console.log("ne geliyo", data)
    return(
        <div className="cards">
            <div className="title">
                <h1>{data.title}</h1>
            </div>
            <div className="date">
                <h1>{data.date}</h1>
            </div>
            <img src={data.image} alt="" />
            <div className="card-over">
                <p>
                    {data.desc}
                </p>
            </div>
        </div>
    )
}

export default Card;
